import './App.css';
import mill from './mill.png';
import Switch from '@mui/material/Button';

function App() {
  return (
    <div className="App">
      <img src={mill} alt="Mill" width={100} />
      <Switch
  checked={checked}
  onChange={handleChange}
  inputProps={{ 'aria-label': 'controlled' }}
/>
    </div>
  );
}

export default App;
